uint8_t getCurrentStep(uint32_t tick_counter)
{

    if (tick_counter > 0 && tick_counter < STEP_A)
    {
        current_step_num = 1;
        return current_step_num;
    }
    else if ((tick_counter > STEP_A) && (tick_counter < STEP_B))
    {
        current_step_num = 2;
        return current_step_num;
    }

    else if ((tick_counter > STEP_B) && (tick_counter < STEP_C))
    {
        current_step_num = 3;
        return current_step_num;
    }
    else if ((tick_counter > STEP_C) && (tick_counter < STEP_D))
    {
        current_step_num = 4;
        return current_step_num;
    }

    else
        return 0xe2;
}

TrajectoryData getTrajectoryData(uint32_t tick_counter)
{
    // 根据trajectory_data数据返回接近tick_counter时间的TrajectoryData结构体
    // 获取当前trajectory_index
    if (tick_counter > trajectory_data[trajectory_index].time)
    {
        trajectory_index++;
    }
    if (trajectory_index == 0)
        return trajectory_data[0];

    // 计算高度差值
    float altitude_diff = trajectory_data[trajectory_index].altitude - trajectory_data[trajectory_index - 1].altitude;
    // 计算时间差值
    float time_diff = trajectory_data[trajectory_index].time - trajectory_data[trajectory_index - 1].time;
    // 计算高度变化率
    float altitude_rate = altitude_diff / time_diff;

    // 创建返回结构体
    TrajectoryData result = trajectory_data[trajectory_index];
    // 计算当前高度
    result.altitude = trajectory_data[trajectory_index - 1].altitude +
                      altitude_rate * (tick_counter - trajectory_data[trajectory_index - 1].time);

    return result;
}

// 通过索引获取dd数据
TrajectoryData getTrajectoryDataWithIndex(uint32_t index)
{
    int temp = trajectory_index + index;
    if (temp < 0)
        return trajectory_data[0];
    if (temp >= trajectory_data_size)
        return trajectory_data[trajectory_data_size - 1];
    return trajectory_data[temp];
}